import React, { Fragment } from 'react';
import HeaderFoto from '../resources/Header-foto.jpg'
const Header = () => {

    const [query, setQuery] = useState('');

    const handleInputChange = (event) => {
      const value = event.target.value;
      const modifiedValue = value.replace(/ /g, '+');
      setQuery(modifiedValue);
    };
  
    const handleSubmit = (event) => {
      event.preventDefault();
      // Aquí puedes realizar la lógica para utilizar la variable "query"
      console.log(query);
    };


    return ( 
        <Fragment>
            <nav className="navbar navbar-light nav-bar">
                <a className="titulo-nav-bar" href="#">Lenspire</a>
            <div class="collapse navbar-collapse" id="navbarTogglerDemo01">
                <a class="navbar-brand" href="#">Hidden brand</a>
                <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
                <li class="nav-item active">
                    <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                </li>
                </ul>
            </div>
            </nav>
            <div>
                <img className='imagen-grande' key="header-img" src={HeaderFoto}></img>
                <div className='titulo'>
                    Lenspire
                </div>
                <div>
                <form className="form-inline my-2 my-lg-0 buscador" onSubmit={handleSubmit}>
                    <input className="form-control mr-sm-2" 
                    type="search" 
                    placeholder="Buscar imagenes" 
                    aria-label="Buscar imagenes"
                    value={query}
                    onChange={handleInputChange}/>
                </form>
                    
                </div>
            </div>
        </Fragment>
     );
}
 
export default Header;
